 const rootReducer = (state , action) =>{
    console.log({state, action})
    switch(action.type){
        case 'todoList/addTodo':
            return {
                ...state,
                todoList: [
                    ...state.todoList,
                    action.payload
                ]
            }

        case 'filters/searchTodoList':
            return {
                ...state,
                todoList: [
                    ...state.todoList,
                    action.payload
                ]
                }    
            default: 
                return state;
    }
}
export default rootReducer
